import "./checkout.styles.scss";

const Checkout = () => {
  return (
    <div className="checkout-container">
      <div className="checkout-header">
        <h3>Product</h3>
        <h3>Description</h3>
        <h3>Quatity</h3>
        <h3>Price</h3>
        <h3>Remove</h3>
      </div>
    </div>
  );
};

export default Checkout;
